import React from 'react'
import {Container, Nav, Navbar, NavbarBrand, NavbarCollapse, Button, NavbarToggle} from 'react-bootstrap'
import logo from '../Components/logo-og.png'
import { useNavigate } from 'react-router-dom';

const NewPage = () => {
	const navigate = useNavigate();
	const handleLogOut = () => {

		navigate('/');
  };

	return (
	<Navbar bg = 'dark' variant = 'dark'>
			<NavbarBrand href = './NewPage'>
				<img src = {logo} 
				height = '30'
				width= '30'
				className='d-inline-block align-top'
				alt='logo' />
			</NavbarBrand>
			<Navbar.Collapse id = 'responsive-navbar-nav'>

				<Nav className='mr-auto'>
					<Nav.Link href = '/'>
						Home
					</Nav.Link>
					<Nav.Link href = '/'>
						About
					</Nav.Link>
					<Nav.Link href = '/'>
						Contacts
					</Nav.Link>
					<Nav.Link href = '/'>
						Blog
					</Nav.Link>
				</Nav>

					<Button variant = "danger" onClick = {handleLogOut}>
						Log Out
					</Button>
			</Navbar.Collapse>
	</Navbar>
	)

};

export default NewPage;
